func shortestPalindrome(s string) string {
	if isPalindrome(s) {
		return s
	}
	lastIndex := len(s) - 1

	indexCounter := 0
	for {
		s = s[:indexCounter] + string(s[lastIndex]) + s[indexCounter:]
		if isPalindrome(s) {
			return s
		}
		indexCounter++
	}
}

