func isPalindrome(s string) bool {
	n := len(s)
	firstPart := (n / 2) - 1
	var secondPart int
	if n%2 == 0 {
		secondPart = firstPart + 1
	} else {
		secondPart = firstPart + 2
	}
	for i := firstPart; i >= 0; i-- {
		if s[i] != s[secondPart] {
			return false
		}
		secondPart++
	}
	return true
}

